import React from "react";
import './navbar.css'
import Logo from "../../assets/img/GSMLogo.svg"

const Navbar = () => {
    return (
        <div className="navbar">
            .contai
            <img src={Logo} alt="GSM" className="navbar__logo" />
            <div className="navbar__header">SMSAlerts</div>
            <div className="navbar__login">Войти</div>
            <div className="navbar__registration">Регистрация</div>
        </div>
    );
};

export default Navbar;
